import React, { useState } from 'react';
import axios from 'axios';
import './Prescription.css';

const PrescriptionPage = () => {
  const [prescription, setPrescription] = useState({
    medicineName: '',
    dosage: '',
    quantity: '',
    frequency: '',
    instructions: '',
    dateIssued: new Date().toISOString().split('T')[0],
    validUntil: '',
    notes: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setPrescription(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const prescriptionData = {
      medicines: [{
        medicineName: prescription.medicineName,
        dosage: prescription.dosage,
        quantity: prescription.quantity,
        frequency: prescription.frequency,
        instructions: prescription.instructions
      }],
      dateIssued: prescription.dateIssued,
      validUntil: prescription.validUntil,
      notes: prescription.notes,
      patientId: "660d6c05b90e304d99eb1234", // Replace with actual patient ID
      doctorId: "660d6c05b90e304d99eb5678" // Replace with actual doctor ID
    };

    try {
      const response = await axios.post('http://localhost:5000/api/prescriptions', prescriptionData);
      alert(response.data.message);
    } catch (error) {
      console.error('Error saving prescription:', error);
      alert('Failed to save prescription');
    }
  };

  return (
    <div className="prescription-container">
      <h1>Medical Prescription</h1>
      <form onSubmit={handleSubmit} className="prescription-form">
        <div className="form-group">
          <label>Medicine Name:</label>
          <input
            type="text"
            name="medicineName"
            value={prescription.medicineName}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Dosage:</label>
          <input
            type="text"
            name="dosage"
            value={prescription.dosage}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Quantity:</label>
          <input
            type="number"
            name="quantity"
            value={prescription.quantity}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Frequency:</label>
          <select
            name="frequency"
            value={prescription.frequency}
            onChange={handleChange}
            required
          >
            <option value="">Select Frequency</option>
            <option value="Once daily">Once daily</option>
            <option value="Twice daily">Twice daily</option>
            <option value="Three times daily">Three times daily</option>
            <option value="Four times daily">Four times daily</option>
            <option value="As needed">As needed</option>
          </select>
        </div>

        <div className="form-group">
          <label>Instructions:</label>
          <textarea
            name="instructions"
            value={prescription.instructions}
            onChange={handleChange}
            required
            rows="3"
          />
        </div>

        <div className="form-group">
          <label>Date Issued:</label>
          <input
            type="date"
            name="dateIssued"
            value={prescription.dateIssued}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Valid Until:</label>
          <input
            type="date"
            name="validUntil"
            value={prescription.validUntil}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Additional Notes:</label>
          <textarea
            name="notes"
            value={prescription.notes}
            onChange={handleChange}
            required
            rows="4"
          />
        </div>

        <button type="submit" className="submit-btn">
          Generate Prescription
        </button>
      </form>
    </div>
  );
};

export default PrescriptionPage;
